import { View, TextInput, Alert, Text, Image } from 'react-native';
import { createAccount } from './../style/style.js';

export default () => {
    <View style={createAccount.container}>
        <TextInput
            style={createAccount.input}
            placeholder="first name"
            placeholderTextColor={"rgba(0,0,0,.3)"}
        ></TextInput>
        <TextInput
            style={createAccount.input}
            placeholder="last name"
            placeholderTextColor={"rgba(0,0,0,.3)"}
        ></TextInput>
        <TextInput
            style={createAccount.input}
            placeholder="email"
            placeholderTextColor={"rgba(0,0,0,.3)"}
        ></TextInput>
        <TextInput
            style={createAccount.input}
            placeholder="username"
            placeholderTextColor={"rgba(0,0,0,.3)"}
        ></TextInput>
        <TextInput
            secureTextEntry={true}
            style={createAccount.input}
            placeholder="password"
            placeholderTextColor={"rgba(0,0,0,.3)"}
        ></TextInput>
        <View style={createAccount.submit}>
            <Text onPress={() => Alert.alert('createAccount')} style={createAccount.submitText}>
                sign in
            </Text>
        </View>
        <View style={createAccount.login}>
            <Text style={createAccount.loginText} numberOfLines={1}>
                already have an account? <Text onPress={() => Alert.alert('login')} style={createAccount.loginButton} >create</Text>
            </Text>
        </View>
    </View>
}
